function main(){loadStuff()}function loadStuff(){$("nav").load("/docs/html/nav.html")}function toggleNav(){if($("nav #top-nav li:nth-child(2)").hasClass("hidden")||$("nav #top-nav li:nth-child(2)").hasClass("hid")){$("nav #top-nav img").addClass("nav-show");for(var a=1;a<$("nav #top-nav li").length;a++)$("nav #top-nav li:nth-child("+(a+1)+")").attr("class","show")}else{$("nav #top-nav img").removeClass("nav-show");for(a=1;a<$("nav #top-nav li").length;a++)$("nav #top-nav li:nth-child("+(a+1)+")").attr("class","hidden")}}main();
